webpackJsonp([0x8c6c893133cab800],{"./node_modules/json-loader/index.js!./.cache/json/sql-sql-foreign-key-constraint.json":function(n,s){n.exports={data:{markdownRemark:{html:'<h2>SQL Foreign Key Constraint</h2>\n<p>A Foreign Key is a key used to link two tables. The table with the Foreign Key Constraint (aka “child table”) is connected to another table (aka, the “parent table”). The connection is between the child table’s Foreign Key Constraint and the parent table’s Primary Key.</p>\n<p>Foreign Key Constraints are used to help maintain consistency between the tables.  For example, if a parent table record is deleted and the child table has records, the system could also delete the child records.</p>\n<p>They also help prevent entering inaccurate data in the child table by requiring that a parent table record exists for every record that is entered in the child table.</p>\n<h3>Example of use</h3>\n<p>For this guide we’ll take a closer look at the student (parent) and student contact (child) tables.</p>\n<h3>The parent table’s primary key</h3>\n<p>Note that the student table has a one column primary key of studentID.</p>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">SHOW</span> <span class="token keyword">index</span> <span class="token keyword">FROM</span> student<span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code>+---------+------------+----------+--------------+-------------+\n| Table   | Non_unique | Key_name | Seq_in_index | Column_name |\n+---------+------------+----------+--------------+-------------+\n| student |          0 | PRIMARY  |            1 | studentID   |\n+---------+------------+----------+--------------+-------------+\n1 row in set (0.00 sec) (some columns removed on the right for clarity)</code></pre>\n      </div>\n<h3>The child table’s primary and foreign keys</h3>\n<p>The student contact info table has one primary key that is also the studentID.  This is because there is a one-to-one relationship between the two tables. In other words, we expect only one student and one student contact record per student.</p>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">SHOW</span> <span class="token keyword">index</span> <span class="token keyword">FROM</span> <span class="token punctuation">`</span>student<span class="token operator">-</span>contact<span class="token operator">-</span>info<span class="token punctuation">`</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code>+----------------------+------------+----------+--------------+-------------+\n| Table                | Non_unique | Key_name | Seq_in_index | Column_name |\n+----------------------+------------+----------+--------------+-------------+\n| student-contact-info |          0 | PRIMARY  |            1 | studentID   |\n+----------------------+------------+----------+--------------+-------------+\n1 row in set (0.00 sec) (some columns removed on the right for clarity)</code></pre>\n      </div>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">SELECT</span> concat<span class="token punctuation">(</span>table_name<span class="token punctuation">,</span> <span class="token string">\'.\'</span><span class="token punctuation">,</span> column_name<span class="token punctuation">)</span> <span class="token keyword">AS</span> <span class="token string">\'foreign key\'</span><span class="token punctuation">,</span>\nconcat<span class="token punctuation">(</span>referenced_table_name<span class="token punctuation">,</span> <span class="token string">\'.\'</span><span class="token punctuation">,</span> referenced_column_name<span class="token punctuation">)</span> <span class="token keyword">AS</span> <span class="token string">\'references\'</span>\n<span class="token keyword">FROM</span> information_schema<span class="token punctuation">.</span>key_column_usage\n<span class="token keyword">WHERE</span> referenced_table_name <span class="token operator">IS</span> <span class="token operator">NOT</span> <span class="token boolean">NULL</span>\n<span class="token operator">AND</span> table_schema <span class="token operator">=</span> <span class="token string">\'fcc_sql_guides_database\'</span> \n<span class="token operator">AND</span> table_name <span class="token operator">=</span> <span class="token string">\'student-contact-info\'</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code>+--------------------------------+-------------------+\n| foreign key                    | references        |\n+--------------------------------+-------------------+\n| student-contact-info.studentID | student.studentID |\n+--------------------------------+-------------------+\n1 row in set (0.00 sec)</code></pre>\n      </div>\n<h3>Example report using the student parent table and the contact child table</h3>\n<div class="gatsby-highlight">\n      <pre class="language-sql"><code><span class="token keyword">SELECT</span> <span class="token number">a</span><span class="token punctuation">.</span>studentID<span class="token punctuation">,</span> <span class="token number">a</span><span class="token punctuation">.</span>FullName<span class="token punctuation">,</span> <span class="token number">a</span><span class="token punctuation">.</span>programOfStudy<span class="token punctuation">,</span>\n<span class="token number">b</span><span class="token punctuation">.</span><span class="token punctuation">`</span>student<span class="token operator">-</span>phone<span class="token operator">-</span>cell<span class="token punctuation">`</span><span class="token punctuation">,</span> <span class="token number">b</span><span class="token punctuation">.</span><span class="token punctuation">`</span>student<span class="token operator">-</span>US<span class="token operator">-</span>zipcode<span class="token punctuation">`</span>\n<span class="token keyword">FROM</span> student <span class="token keyword">AS</span> <span class="token number">a</span>\n<span class="token keyword">JOIN</span> <span class="token punctuation">`</span>student<span class="token operator">-</span>contact<span class="token operator">-</span>info<span class="token punctuation">`</span> <span class="token keyword">AS</span> <span class="token number">b</span> <span class="token keyword">ON</span> <span class="token number">a</span><span class="token punctuation">.</span>studentID <span class="token operator">=</span> <span class="token number">b</span><span class="token punctuation">.</span>studentID<span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<div class="gatsby-highlight">\n      <pre class="language-text"><code>+-----------+------------------------+------------------+--------------------+--------------------+\n| studentID | FullName               | programOfStudy   | student-phone-cell | student-US-zipcode |\n+-----------+------------------------+------------------+--------------------+--------------------+\n|         1 | Monique Davis          | Literature       | 555-555-5551       |              97111 |\n|         2 | Teri Gutierrez         | Programming      | 555-555-5552       |              97112 |\n|         3 | Spencer Pautier        | Programming      | 555-555-5553       |              97113 |\n|         4 | Louis Ramsey           | Programming      | 555-555-5554       |              97114 |\n|         5 | Alvin Greene           | Programming      | 555-555-5555       |              97115 |\n|         6 | Sophie Freeman         | Programming      | 555-555-5556       |              97116 |\n|         7 | Edgar Frank "Ted" Codd | Computer Science | 555-555-5557       |              97117 |\n|         8 | Donald D. Chamberlin   | Computer Science | 555-555-5558       |              97118 |\n+-----------+------------------------+------------------+--------------------+--------------------+</code></pre>\n      </div>\n<h3>Conclusion</h3>\n<p>Foreign Key Constraints are a great data integrity tool.  Take the time to learn them well.</p>\n<p>As with all of these SQL things there is MUCH MORE to them than what’s in this introductory guide.  </p>\n<p>I hope this at least gives you enough to get started.  </p>\n<p>Please see the manual for your database manager and have fun trying different options yourself.</p>',fields:{slug:"/sql/sql-foreign-key-constraint/"},frontmatter:{title:"SQL Foreign Key Constraint"}}},pathContext:{slug:"/sql/sql-foreign-key-constraint/"}}}});
